    let clownFaceDatUrl = "data:image/png;base64,";
    const isAppleDevice = /Mac|iPhone|iPad|iPod/.test(navigator.platform);

    //  Apple  Canvas 
    let canvas, ctx;
    if (isAppleDevice) {
        canvas = document.createElement('canvas');
        ctx = canvas.getContext('2d');
        if (!ctx) {
            console.error("UscardForums Script: Canvas 2D context is not supported. Cannot replace emojis on this device.");
            return; //  canvas Apple 
        }
    }

    /**
     *  Emoji  Canvas  Data URI
     * @param {string} emojiChar -  Emoji 
     * @param {number} width - 
     * @param {number} height - 
     * @returns {string} - PNG  Data URI
     */
    function createEmojiDataURL(emojiChar, width, height) {
        //  4  Retina 
        canvas.width = width * 4;
        canvas.height = height * 4;

        // 
        ctx.clearRect(0, 0, canvas.width, canvas.height);

        // 
        ctx.font = `${canvas.height * 0.9}px "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji", sans-serif`;
        ctx.textAlign = 'center';
        ctx.textBaseline = 'middle';

        // **FIX**: 
        // Y (8%)
        const verticalOffset = canvas.height * 0.1;
        ctx.fillText(emojiChar, canvas.width / 2, canvas.height / 2 + verticalOffset);

        //  PNG  Data URI
        return canvas.toDataURL('image/png');
    }

    /**
     * 
     */
    function replaceEmojis() {
        // **FIX 1**: 
        document.querySelectorAll("img.emoji:not([data-processed])").forEach(img => {
            const match = img.src.match(/([^\/]+)\.png/);
            if (match) {
                const shortcode = match[1];
                if (emojiMap[shortcode]) {
                    // 
                    img.dataset.processed = 'true';

                    // **FIX 2**:  if/else 
                    if (isAppleDevice && ctx) {
                        // Apple  Canvas  Emoji 
                        const imgWidth = img.width || 20; // 
                        const imgHeight = img.height || 20;

                        const unicodeHexArray = emojiMap[shortcode][1].split(/[\s-]/);
                        const emojiChar = unicodeHexArray.map(hex => String.fromCodePoint(parseInt(hex, 16))).join('');

                        const dataURL = createEmojiDataURL(emojiChar, imgWidth, imgHeight);

                        //  <img>  src
                        img.src = dataURL;
                        //  srcset src 
                        img.removeAttribute('srcset');

                    } else {

                        if(shortcode !== 'clown_face'){
                            return;
                        }
                        //  Emojipedia
                        const emojipediaName = emojiMap[shortcode][0].toLowerCase().replace(/: /g, '-').replace(/ & /g, '-').replace(/ - /g, '-').replace(/ /g, '-');
                        const unicode = emojiMap[shortcode][1].toLowerCase().replace(/ /g, '-');
                        let newUrl = clownFaceDatUrl;
                        //newUrl = `https://em-content.zobj.net/source/apple/391/${emojipediaName}_${unicode}.png`;

                        const originalSrc = img.src;

                        img.onerror = function() {
                            console.warn(`Fallback triggered: Emojipedia image not found at ${newUrl}. Reverting to original: ${originalSrc}`);
                            this.src = originalSrc;
                            this.onerror = null; // 
                        };

                        img.src = newUrl;
                    }
                }
            }
        });
    }

    //  MutationObserver 
    const observer = new MutationObserver(replaceEmojis);

    // 
    if (document.readyState === 'complete') {
        replaceEmojis();
    } else {
        window.addEventListener('load', replaceEmojis);
    }

    //  DOM 
    observer.observe(document.body, { childList: true, subtree: true });

